(22, 'MERLYN LAW FIRM', 'MERLYN GROUP OF COMPANY', 1, '4444', '13-10-2022', '<p>India&rsquo;s Leading Law Firm</p>\r\n<p>We aim to deliver exceptional yet affordable legal services in Criminal Law, Family &amp; Divorce Law, Civil Litigation, Real Estate Law, Medical Law, Sports Law, Immigration &amp; Employment Laws.</p>', '/uploadFiles/logo/1661142214.png', '<p>No:323, Thambu Chetty Street, Room No.24, III Floor, LIC Andhra Insurance Building</p>', 100, 85, 64, '653232', 'Madhan', 'CEO', 'madhan@gmail.com', '+9184565461', '+91545454', '34,35', '12345', 'rasers', 'sdfs', 'sdfs', 'sdfs', NULL, '07sdhfskj@gskl.com', 'raskjd', NULL, NULL, 'uploadFiles/firm/gallery/KvpUhrsyltqO1ymv2vAOTYwbBlblpSlF1uEjI6BO.jpg', '2022-12-02 06:27:30', '2022-10-13 12:57:00', 1, '[{\"sunday_from\":\"18:25\",\"sunday_to\":\"23:25\",\"day\":\"sunday\"}]', '[]', '[]', '[]', '[]', '[]', '[]', 2, NULL, '0', '0', NULL, NULL),
(24, 'Neuro Foundation Hospital', 'Neuro Foundation Hospital pvt Ltd', 1, '12', '15-10-2022', '<p>To enable early easy and sure access to state of the art comprehensive treatment methods in Neurology, Neurosurgery and Mental health to every needy person with Neurological illness, round the clock.</p>', '/uploadFiles/logo/sample.jpg', '<p>Three Roads, Meyyanur Main Rd, Salem, Tamil Nadu 636009</p>', 100, 85, 65, '636009', 'Ramesh', 'nero', 'dskdjf@gmail.com', '+91', '+91', '30,37,29', '1111', '11', '11', '11', 'Salem', NULL, '07sdhskj@gskl.com', 'raskjd', NULL, NULL, 'uploadFiles/firm/gallery/83EEtk2epH9MKol9zmpZtOADR1pCMJGzwQ7Kv0ac.jpg,uploadFiles/firm/gallery/s5pKI55PgMQVaQjfcUJafcRSiVTDrmgFGGO7QyVy.jpg,uploadFiles/firm/gallery/zLAN0A5Ve8OOrAgcvryId7DcMR0vx0vjxVRNZpPR.jpg', '2022-12-02 06:27:30', '2022-10-15 07:38:36', 1, '[{\"sunday_from\":\"13:07\",\"sunday_to\":\"02:08\",\"day\":\"sunday\"}]', '[]', '[]', '[]', '[]', '[]', '[]', 2, NULL, '0', '0', NULL, NULL),
